    RadioGroup,
    Icon,
    StarIcon
} from "@chakra-ui/react"



export default function StarSelect(){

    return (
        <div> 
            <Wrap bg="orange.500" borderRadius="lg" padding="10px">
                <h2>Rating</h2>
